/* Persecution of Armenians */Corrected content. The Armenian genocide was motivated by ethnic tension, not religious content. If it were religious, there would also have been genocide of Greeks and Catholics. 

Also, if the genocide was motivated by religious hatred, why did the fleeing Armenians settle in largely Muslim nations, such as Syria, Palestine, and Lebanon? To this day, Armenians continue to thrive and prosper in Muslim-majority (Arab) nation.

